import { ref, onMounted } from 'vue'
import { useNuxtApp } from '#app'
import { useMatchMedia } from '@/composables/useMatchMedia'
const store = useMainStore()
const { $gsap: gsap } = useNuxtApp()
const moreIcons = ref(null)
const secondaryIcons = ref(null)
const finished = ref(false)
function iconMapFX({ isDesktop, isTablet, isMobile }) {
    nextTick(() => {

        const secondaryIconsEl = secondaryIcons.value
        const iconsContainer = secondaryIconsEl.querySelector('svg')
        const iconsEl = iconsContainer.querySelectorAll('g.opacity-0')
        const iconMapAnim = gsap.timeline({ paused: true })
        iconMapAnim.set(iconsEl, {
            autoAlpha: 0,
        })
        if (!finished.value) {
            iconMapAnim.to(iconsEl, {
                autoAlpha: 1,
                duration: 0.3,
                stagger: 0.3,
                ease: 'power1.inOut'
            }, 0)

            iconMapAnim.addLabel('iconsRotate', '+=1')
            iconMapAnim.to(moreIcons.value, {
  rotation: 1080,                // number is fine
  duration: 15,
  repeat: -1,
  yoyo: true,
  repeatDelay: 0.5,
  transformOrigin: '50% 50%',    // correct spelling
  ease: 'power1.inOut',
}, '+=0.9')
            iconMapAnim.to(iconsEl, {
                rotation: '-1080deg',
                duration: 15,
                repeat: -1,
                repeat: -1,
                yoyo: true,
                repeatDelay: 0.5,
                ease: 'power1.inOut',transformBox: 'fillBox',
            }, '-=15.9')

            iconMapAnim.play()
            finished.value = true
        }
    })
}
useMatchMedia(iconMapFX)
